  {
    pattern: "messanger",
    alias: ["send"],
    desc: "Forward a constant message to specific numbers",
    type: "whatsapp",
  },
  async (message, args) => {
    try {
      // Define the constant message to forward
      const constantMessage = { text: "Make a constant message" };

      // Check if numbers were provided
      if (!args) {
        return await message.reply(
          "*Please provide one or more phone numbers.*\nExample: ,forward7 2349112171078 2348012345678"
        );
      }

      // Split the numbers by spaces and format each as a JID
      const jids = args.split(" ").map((num) => `${num.trim()}@s.whatsapp.net`);

      // Forward the constant message to each JID
      for (const jid of jids) {
        await message.bot.sendMessage(jid, constantMessage);
      }

    } catch (error) {
      await message.reply("An error occurred: " + error.message);
    }
  }
);

